func (c *current) onConfig1(items, item any) (any, error) {
	document := NewDocument()
	itemsT, ok := items.([]any)
	if !ok {
		return nil, fmt.Errorf("invalid type in Config - expected []any")
	}
	for _, vx := range itemsT {
		vxx := fromIdxOfUntypedSlice(vx, 0)
		switch vt := vxx.(type) {
		case *Attr:
			document.PosAttrs = append(document.PosAttrs, vt)
		case *Structure:
			document.Structures = append(document.Structures, vt)
		case *KeyVal:
			document.Entries = append(document.Entries, vt)
		}
	}

	switch vt := item.(type) {
	case *Attr:
		document.PosAttrs = append(document.PosAttrs, vt)
	case *Structure:
		document.Structures = append(document.Structures, vt)
	case *KeyVal:
		document.Entries = append(document.Entries, vt)
	}
	return document, nil

}

